e que se consolidou ao longo do século XX. A sociedade de massa é caracterizada pela produção em massa, pela industrialização em larga escala e pela organização em estruturas burocráticas complexas.

Entre as principais características da sociedade de massa, destacamos:

- A produção em massa de bens e serviços, que promove a uniformidade e a padronização das mercadorias;
- O desenvolvimento dos meios de comunicação de massa (rádio, televisão, jornais, revistas, internet), que permitem a rápida disseminação das informações e dos valores culturais;
